import React from 'react';
import Card from '../UI/Card';
import './style.css';

const Sidebar=props=>{
    return(
        <div className="sidebarContainer">
        <Card>
            <div className="cardHeader">
            <span>About Us</span>
            
            </div>
        </Card>
        </div>

       
    );
}

export default Sidebar;
